import org.apache.spark.storage.StorageLevel


Config.reloadConfigs(sc)
Config.registerUDFs()
val sqlContext = Config.getSqlContext()
val hadoopConf = Config.getSparkContext().hadoopConfiguration
hadoopConf.set("fs.s3a.access.key",hadoopConf.get("fs.s3.awsAccessKeyId"))
hadoopConf.set("fs.s3a.secret.key",hadoopConf.get("fs.s3.awsSecretAccessKey"))

//val paths=["s3a://production-s3-basin/events_v4/event_date=2017-10-21/verb={click,view,post}/*", 
//            ]
//verb={click,view,post}
val resultDF=sqlContext.read.load("s3a://production-s3-basin/events_v4/event_date=2017-10-21/verb={click,view,post}/*")
.filter(_.getAs[Row]("using").getAs("app_type")=="iphone")
val repartitionedDF=resultDF.repartition($"actor.id").sort($"at")
repartitionedDF.foreachPartition{iterator => iterator.foreach { row =>
    val onRow = row.getAs[Row]("on")
    val toRow = row.getAs[Row]("to")
    val directObjectName = row.getAs[Row]("direct_object").getAs("name")
    if (onRow != null) {
        //click on
        println(s"click ${directObjectName} on page ${onRow.getAs("name")}")
    } else if(toRow !=null){
        //post
        println(s"post ${directObjectName} to page ${toRow.getAs("type")}")
    }else {
        //page view
        println(s"view page ${directObjectName}")
    }
  }
}
repartitionedDF.show(5)
//resultDF.take(10).map(row => println(row.getStruct(1)))
repartitionedDF.explain
//print("Partitions structure: {}".format(repartitionedDF.glom().collect()))

